           userList.push(newUser);
           console.log("NEWUSER", newUser);
           console.log("HASEDPASSWORD", hashedPassword)

           res.json({
               status: "New user has been created",
               data: newUser
           })
       }
   } catch (err) {
       console.log(err);
       res.json(err);
   }
});

export default router;

